import { Component } from "react";
import { Container } from "react-bootstrap";

import NavigationBar from "./NavigationBar.jsx";

class Actors extends Component {
  render() {
    return (
      <Container fluid>
        <NavigationBar />
        <h1>Actors</h1>
      </Container>
    )
  }
}

export default Actors;
